def encryption(key, full):
        ctr = Counter.new(128)
        cipher = AES.new(key, AES.MODE_CTR,counter=ctr)
        with open(full, "r+b") as f :
            size = 16
            text = f.read(size)
            while text :
                en_f = cipher.encrypt(text)
                f.seek(-len(text),1)
                new_file = f.write(en_f)
                text = f.read(size)
            f.close()
            os.rename(full , full + ".en")

def decryption(key, full):
        ctr = Counter.new(128)
        size = 16
        d = AES.new(key, AES.MODE_CTR,counter=ctr)
        with open(full, "r+b") as f :
            text = f.read(size)
            while text :
                f.seek(-len(text),1)
                file = d.decrypt(text)
                f.write(file)
                text = f.read(size)
            f.close()
            os.rename(full , full.strip(".en"))

